// @ts-nocheck
const METADATA = {
  website: "https://github.com/RevenMyst/ShapeZMod",
  author: "Reven",
  name: "Color Remover",
  version: "1.2",
  id: "reven-color-remover-mod",
  description: "add building to remove color",
};

shapez.enumItemProcessorTypes.colorRemover = "colorRemover";

shapez.MOD_ITEM_PROCESSOR_SPEEDS.colorRemover = () => 10;

shapez.MOD_ITEM_PROCESSOR_HANDLERS.colorRemover = function (payload) {
  const shapeDefinition = payload.items.get(0).definition;

  // cloned item (NEVER modify the incoming item!)
  const newLayers = shapeDefinition.getClonedLayers();
  newLayers.forEach((layer) => {
    // for each layer, each corner is replaced with the same corner but uncolored
    layer[shapez.BOTTOM_LEFT] = {
      subShape: layer[shapez.BOTTOM_LEFT].subShape,
      color: "uncolored",
    };
    layer[shapez.BOTTOM_RIGHT] = {
      subShape: layer[shapez.BOTTOM_RIGHT].subShape,
      color: "uncolored",
    };
    layer[shapez.TOP_LEFT] = {
      subShape: layer[shapez.TOP_LEFT].subShape,
      color: "uncolored",
    };
    layer[shapez.TOP_RIGHT] = {
      subShape: layer[shapez.TOP_RIGHT].subShape,
      color: "uncolored",
    };
  });

  const newDefinition = new shapez.ShapeDefinition({ layers: newLayers });
  payload.outItems.push({
    item: this.root.shapeDefinitionMgr.getShapeItemFromDefinition(
      newDefinition
    ),
  });
};

class MetacolorRemoverBuilding extends shapez.ModMetaBuilding {
  constructor() {
    super("colorRemover");
  }
  // unlock with painter
  getIsUnlocked(root) {
    return root.hubGoals.isRewardUnlocked(
      shapez.enumHubGoalRewards.reward_painter
    );
  }

  static getAllVariantCombinations() {
    return [
      {
        variant: shapez.defaultBuildingVariant,
        name: "Color Remover",
        description: "Use this to remove the all colors of a piece",

        regularImageBase64: RESOURCES["colorRemover.png"],
        blueprintImageBase64: RESOURCES["colorRemoverBlueprint.png"],
        tutorialImageBase64: RESOURCES["colorRemover.png"],
      },
    ];
  }

  getSilhouetteColor() {
    return "red";
  }

  setupEntityComponents(entity) {
    // set custom processor
    entity.addComponent(
      new shapez.ItemProcessorComponent({
        inputsPerCharge: 1,
        processorType: shapez.enumItemProcessorTypes.colorRemover,
      })
    );
    // add ejector
    entity.addComponent(
      new shapez.ItemEjectorComponent({
        slots: [
          { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.top },
        ],
      })
    );
    // add injector with filter shape
    entity.addComponent(
      new shapez.ItemAcceptorComponent({
        slots: [
          {
            pos: new shapez.Vector(0, 0),
            direction: shapez.enumDirection.bottom,
            filter: "shape",
          },
        ],
      })
    );
  }
}

class Mod extends shapez.Mod {
  init() {
    // Register the new building
    this.modInterface.registerNewBuilding({
      metaClass: MetacolorRemoverBuilding,
      buildingIconBase64: RESOURCES["colorRemover.png"],
    });

    // Add it to the regular toolbar
    this.modInterface.addNewBuildingToToolbar({
      toolbar: "regular",
      location: "primary",
      metaClass: MetacolorRemoverBuilding,
    });
  }
}

